import usuario from './usuario.png';
import './Home.css';

function App() {
  return (
    <div>
      <div >
          <img src={usuario} className="Foto"/>
      </div>
      <div>
          <p>
            Edit <code>src/App.js</code> and save.
          </p>
          <a
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
      </div>
    </div>
  );
}

export default App;
